sys_variable_value.value:
(function execute(inputs, outputs) {
    var imp_id = inputs.integration_capability_implementation.sys_id;
    var util = new x_952688_domaintoo.DomainToolsObservableEnrichment(imp_id, inputs.domain_id);
    outputs.results=util.actionRequest(inputs.observable,inputs.active, inputs.create_date, inputs.expiration_date);
})(inputs, outputs);

